import React from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import styled from "styled-components";

const UnitCard = (props) => {
  return (
    <Wrap>
      <ItemText>
        <h3>Unit ID Number: {props.unit.id} (Use this to search Unit)</h3>
        <ItemText>
          <img sr="../images/solar-panel.jpg" />
        </ItemText>
        <p>Description: {props.unit.unit_description}</p>
        <ItemText>
          <ItemText>
            <p>Balconies: {props.unit.num_of_balcony}</p>
            <p>Bedrooms: {props.unit.bedrooms}</p>
            <p>Bathrooms: {props.unit.num_of_bathrooms}</p>
          </ItemText>
          <ItemText>
            <p>Available Start Date{props.unit.unit_availability_start_date}</p>
            <p>Available End Date{props.unit.unit_availability_end_date}</p>
            <p>Unit Sqft: {props.unit.living_area_sf}</p>
          </ItemText>
        </ItemText>
      </ItemText>
    </Wrap>
  );
};

export default UnitCard;

const Wrap = styled.div`
  z-index: 10;
  width: 100vw;
  height: 100vh;
  margin: 50px;
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  background-image: url("/images/solar-panel.jpg");
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;
`;

const ItemText = styled.div`
  z-index: 10;
  color: black;
  text-align: center;
`;

const ButtonGroup = styled.div`
  display: flex;
  margin-bottom: 50px;
  @media (max-width: 1000px) {
    flex-direction: column;
  }
`;
const FirstButton = styled.div`
  width: 300px;
  color: white;
  background-color: rgba(23, 26, 32, 0.8);
  height: 40px;
  display: flex;
  justify-content: center;
  align-items: center;
  border-radius: 60px;
  opacity: 0.85;
  text-transform: uppercase;
  font-size: 12px;
  cursor: pointer;
  text-align: center;

  li {
    padding: 20px 0;
    text-color: white;
    border-radius: 10px;
    opacity: 0.85;
    text-transform: uppercase;
    font-size: 12px;
    cursor: pointer;
    text-align: center;
  }
`;
const SecondButton = styled(FirstButton)``;
